script: |
  super -f text -I q6310.spq | sort > q6310.out

inputs:
  - name: q6310.spq
    data: |
      SELECT ALL col0 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT + CAST ( NULL AS INTEGER ) NOT IN ( - ( + col0 ) * col1 ) OR NOT col0 / + ( col1 ) IS NOT NULL;
  - name: tab2

outputs:
  - name: q6310.out
    data: |
